import React, {useState, useEffect} from "react";
import { useParams } from "react-router-dom";
import NParksServiceRequest from "../apis/nationalParksApi";
import NavBar from "../NavBar";
import '../css/SearchResults.css'

const SearchResults = ({token, setToken}) => {

  const { searchTerm } = useParams()
  const [results, setResults] = useState(null)

  useEffect(() => {
    const doSearch = async () => {
      const response = await NParksServiceRequest.searchNationalParks(searchTerm)
      console.log(searchTerm)
      console.log(response)
      setResults(response)
    }
    doSearch()
  }, [])

  return (
    <div id="search-results-main-container">
      <NavBar
        token={token}
        setToken={setToken}
      />
      <h1>Search Results</h1>
      <div id="search-results-item-container">
        {results && results.map(item => {
          return (
            <div className="search-results-item-container">
              <p>{item.name}</p>
              <p>{item.parkCode}</p>
            </div>
          )
        })}

      </div>
    </div>
  )
}

export default SearchResults;
